  `gmt_modified` datetime DEFAULT NULL COMMENT '修改时间',
  `db_source` varchar(255) DEFAULT NULL COMMENT '数据库来源',
  PRIMARY KEY (`m_id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8 COMMENT='菜单表';
